// src/components/InsuranceBills.jsx
import React, { useState, useEffect, useRef } from 'react';
import {
  ArrowLeft,
  Search,
  Printer,
  Trash2,
  Edit,
  FileText,
  Calendar,
  X,
  Save,
  Send,
  CheckCircle,
  XCircle,
  Loader,
  Plus,
} from 'lucide-react';
import { collection, onSnapshot, doc, deleteDoc, updateDoc } from 'firebase/firestore';
import { db } from '../utils/firebase';
import html2canvas from 'html2canvas';
import jsPDF from 'jspdf';

export default function InsuranceBills({ setCurrentPage }) {
  const [bills, setBills] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [editingBill, setEditingBill] = useState(null);
  const [whatsappModal, setWhatsappModal] = useState(null);
  const [whatsappNumber, setWhatsappNumber] = useState('');
  const [isChecking, setIsChecking] = useState(false);
  const [numberStatus, setNumberStatus] = useState(null); // 'valid', 'invalid', null
  const [isSending, setIsSending] = useState(false);
  const printRef = useRef(null);

  // Fetch bills from Firestore
  useEffect(() => {
    const unsubscribe = onSnapshot(collection(db, 'insuranceBills'), (snapshot) => {
      const billsData = snapshot.docs.map((doc) => ({
        id: doc.id,
        ...doc.data(),
      }));
      setBills(billsData.sort((a, b) => new Date(b.createdAt) - new Date(a.createdAt)));
    });

    return () => unsubscribe();
  }, []);

  const filteredBills = bills.filter(
    (bill) =>
      bill.patientName?.toLowerCase().includes(searchTerm.toLowerCase()) ||
      bill.insuranceNumber?.toLowerCase().includes(searchTerm.toLowerCase()) ||
      bill.patientCNIC?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleDelete = async (bill) => {
    if (
      window.confirm(
        `Are you sure you want to delete insurance bill ${bill.insuranceNumber} for ${bill.patientName}?`
      )
    ) {
      try {
        await deleteDoc(doc(db, 'insuranceBills', bill.id));
        alert('Insurance bill deleted successfully');
      } catch (error) {
        console.error('Error deleting bill:', error);
        alert('Failed to delete bill: ' + error.message);
      }
    }
  };

  const handleEdit = (bill) => {
    setEditingBill({
      ...bill,
      medicinesPrescribed: bill.medicinesPrescribed || [],
      labsOrdered: bill.labsOrdered || [],
    });
  };

  const updateMedicine = (index, field, value) => {
    const newMeds = [...editingBill.medicinesPrescribed];
    newMeds[index][field] = value;
    setEditingBill({ ...editingBill, medicinesPrescribed: newMeds });
  };

  const addMedicine = () => {
    const newMeds = [
      ...editingBill.medicinesPrescribed,
      { name: '', dosage: '', morning: '', daily: '', evening: '' },
    ];
    setEditingBill({ ...editingBill, medicinesPrescribed: newMeds });
  };

  const removeMedicine = (index) => {
    const newMeds = editingBill.medicinesPrescribed.filter((_, i) => i !== index);
    setEditingBill({ ...editingBill, medicinesPrescribed: newMeds });
  };

  const updateLab = (index, value) => {
    const newLabs = [...editingBill.labsOrdered];
    newLabs[index].name = value;
    setEditingBill({ ...editingBill, labsOrdered: newLabs });
  };

  const addLab = () => {
    const newLabs = [...editingBill.labsOrdered, { name: '' }];
    setEditingBill({ ...editingBill, labsOrdered: newLabs });
  };

  const removeLab = (index) => {
    const newLabs = editingBill.labsOrdered.filter((_, i) => i !== index);
    setEditingBill({ ...editingBill, labsOrdered: newLabs });
  };

  const handleSaveEdit = async () => {
    try {
      if (!editingBill.patientName.trim()) return alert('Patient name is required.');
      if (!editingBill.patientAge.trim()) return alert('Patient age is required.');
      if (!editingBill.patientCNIC.trim()) return alert('Patient CNIC is required.');
      if (!editingBill.diagnosis.trim()) return alert('Diagnosis is required.');

      const { id, ...billData } = editingBill;
      const medTotal = parseFloat(billData.medicineTotal || 0);
      const docFees = parseFloat(billData.doctorFees || 0);
      billData.totalAmount = (medTotal + docFees).toFixed(2);

      await updateDoc(doc(db, 'insuranceBills', id), billData);
      alert('Insurance bill updated successfully');
      setEditingBill(null);
    } catch (error) {
      console.error('Error updating bill:', error);
      alert('Failed to update bill: ' + error.message);
    }
  };

  const handlePrint = (bill) => {
    const printWindow = window.open('', '_blank');
    printWindow.document.write(generatePrintHTML(bill));
    printWindow.document.close();
    printWindow.focus();
    setTimeout(() => {
      printWindow.print();
      printWindow.close();
    }, 250);
  };

  const generatePrintHTML = (bill) => {
    // Paste your base64 encoded image strings here
    const headerBase64 = ''
        return `
      <!DOCTYPE html>
      <html>
        <head>
          <title>Insurance Bill - ${bill.insuranceNumber}</title>
          <style>
            @page {
              size: A4;
              margin: 5mm;
            }
            * {
              margin: 0;
              padding: 0;
              box-sizing: border-box;
            }
            body {
              font-family: 'Arial', sans-serif;
              font-size: 11pt;
              font-weight:bold;
              line-height: 1.1;
              color: #000;
              padding: 10mm;
            }
            .header {
              text-align: center;
              border-bottom: 3px solid #000;
              padding-bottom: 0px;
              margin-bottom: 0px;
            }
            .header img {
              width: 100%;
              height: auto;
            }
            .not-valid {
              text-align: center;
              color: red;
              font-weight: bold;
              margin: 8px 0;
              font-size: 12pt;
            }
            .doctor-info {
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: left;
  font-weight: bold;
  line-height: 1.2;
  margin-bottom: 5px; /* Empty space */
}

            .section {
              margin-bottom: 5px;
              border: 2px solid #000;
              padding: 10px;
            }
            .section-title {
              font-size: 12pt;
              font-weight: bold;
              margin-bottom: 5px;
              background-color: #000;
              color: #fff;
              padding: 5px 8px;
              margin: -10px -10px 10px -10px;
            }
            .patient-grid {
              display: grid;
              grid-template-columns: 1fr 1fr;
              gap: 2px;
            }
            .field {
              margin-bottom: 6px;
            }
            .field-label {
              font-weight: bold;
              display: inline-block;
              width: 120px;
            }
            .field-value {
              display: inline;
            }
            table {
              width: 100%;
              border-collapse: collapse;
              margin-top: 8px;
            }
            th, td {
              border: 1px solid #000;
              padding: 6px;
              text-align: left;
            }
            th {
              background-color: #000;
              color: #fff;
              font-weight: bold;
            }
            .diagnosis-text {
              margin-top: 8px;
              padding: 5px;
              
              background-color: #f9f9f9;
              min-height: 40px;
            }
            .billing-summary {
              margin-top: 15px;
              border: 3px solid #000;
              padding: 10px;
              background-color: #f5f5f5;
            }
            .billing-row {
              display: flex;
              justify-content: space-between;
              padding: 6px 0;
              font-size: 12pt;
            }
            .billing-label {
              font-weight: bold;
            }
            .billing-value {
              font-weight: bold;
            }
            .total-row {
              border-top: 2px solid #000;
              margin-top: 6px;
              padding-top: 8px;
              font-size: 14pt;
            }
            ul {
              margin-top: 8px;
              padding-left: 20px;
            }
            li {
              margin-bottom: 4px;
            }
          </style>
        </head>
        <body>
          <div class="header">
            ${headerBase64 ? `<img src="data:image/png;base64,${headerBase64}" />` : ''}
          </div>

          <p class="not-valid">NOT VALID FOR COURT</p>

          <div class="doctor-info">
            <span>Doctor Name: Dr. Huzaifa Naeem</span>
            <span>PMDC License No: 947956-01-M</span>
            <span>Contact No: 03056802371</span>
            <span>Insurance Bill No: ${bill.insuranceNumber}</span>
          </div>

          <div class="section">
            <div class="section-title">PATIENT INFORMATION</div>
            <div class="patient-grid">
              <div class="field">
                <span class="field-label">Patient Name:</span>
                <span class="field-value">${bill.patientName}</span>
              </div>
              <div class="field">
                <span class="field-label">Age:</span>
                <span class="field-value">${bill.patientAge}</span>
              </div>
              <div class="field">
                <span class="field-label">Contact:</span>
                <span class="field-value">${bill.patientContact || 'N/A'}</span>
              </div>
              <div class="field">
                <span class="field-label">CNIC:</span>
                <span class="field-value">${bill.patientCNIC}</span>
              </div>
              <div class="field">
                <span class="field-label">Gender:</span>
                <span class="field-value">${bill.gender}</span>
              </div>
              <div class="field">
                <span class="field-label">Date:</span>
                <span class="field-value">${bill.date}</span>
              </div>
            </div>
          </div>

          <div class="section">
            <div class="section-title">DIAGNOSIS</div>
            <div class="diagnosis-text">${bill.diagnosis}</div>
          </div>

          ${
            bill.medicinesPrescribed && bill.medicinesPrescribed.length > 0
              ? `
          <div class="section">
            <div class="section-title">MEDICINES PRESCRIBED</div>
            <table>
              <thead>
                <tr>
                  <th style="width: 35%;">Medicine Name</th>
                  <th style="width: 20%;">Dosage</th>
                  <th style="width: 15%;">Morning</th>
                  <th style="width: 15%;">Daily</th>
                  <th style="width: 15%;">Evening</th>
                </tr>
              </thead>
              <tbody>
                ${bill.medicinesPrescribed
                  .map(
                    (med) => `
                  <tr>
                    <td><strong>${med.name}</strong></td>
                    <td>${med.dosage || '-'}</td>
                    <td>${med.morning || '-'}</td>
                    <td>${med.daily || '-'}</td>
                    <td>${med.evening || '-'}</td>
                  </tr>
                `
                  )
                  .join('')}
              </tbody>
            </table>
          </div>
          `
              : ''
          }

          ${
            bill.labsOrdered && bill.labsOrdered.length > 0
              ? `
          <div class="section">
            <div class="section-title">LABS ORDERED</div>
            <ul>
              ${bill.labsOrdered.map((lab) => `<li><strong>${lab.name}</strong></li>`).join('')}
            </ul>
          </div>
          `
              : ''
          }

          <div class="billing-summary">
            <div class="billing-row">
              <span class="billing-label">Medicine Total:</span>
              <span class="billing-value"> ${parseFloat(bill.medicineTotal || 0).toFixed(
                2
              )}</span>
            </div>
            <div class="billing-row">
              <span class="billing-label">Doctor Fees:</span>
              <span class="billing-value"> ${parseFloat(bill.doctorFees || 0).toFixed(2)}</span>
            </div>
            <div class="billing-row total-row">
              <span class="billing-label">TOTAL AMOUNT:</span>
              <span class="billing-value"> ${parseFloat(bill.totalAmount || 0).toFixed(
                2
              )}</span>
            </div>
          </div>

        </body>
      </html>
    `;
  };

  const openWhatsAppModal = (bill) => {
    // Pre-fill with patient contact if available
    const patientContact = bill.patientContact || '';
    setWhatsappNumber(patientContact);
    setWhatsappModal(bill);
    setNumberStatus(null);
  };

  const formatWhatsAppNumber = (number) => {
    // Remove all non-digit characters
    let cleaned = number.replace(/\D/g, '');
    
    // If starts with 0, remove it and add 92 (Pakistan)
    if (cleaned.startsWith('0')) {
      cleaned = '92' + cleaned.substring(1);
    }
    
    // If doesn't start with country code, add 92
    if (!cleaned.startsWith('92')) {
      cleaned = '92' + cleaned;
    }
    
    return cleaned;
  };

  const checkWhatsAppNumber = async () => {
    if (!whatsappNumber.trim()) {
      alert('Please enter a WhatsApp number');
      return;
    }

    setIsChecking(true);
    setNumberStatus(null);

    try {
      const formattedNumber = formatWhatsAppNumber(whatsappNumber);
      
      // Simple validation: Pakistan numbers should be 12 digits (92 + 10 digits)
      if (formattedNumber.length !== 12) {
        setNumberStatus('invalid');
        setIsChecking(false);
        alert('Invalid number format. Pakistan numbers should be 10 digits (e.g., 0300-1234567)');
        return;
      }

      // For now, we'll assume the number is valid if format is correct
      // In a real implementation, you would call a WhatsApp Business API to verify
      setNumberStatus('valid');
      setIsChecking(false);
      
    } catch (error) {
      console.error('Error checking number:', error);
      setNumberStatus('invalid');
      setIsChecking(false);
    }
  };

  const generatePDF = async (bill) => {
    try {
      // Create a temporary container for the bill
      const container = document.createElement('div');
      container.innerHTML = generatePrintHTML(bill).replace('<!DOCTYPE html><html><head>', '').replace('</head><body>', '').replace('</body></html>', '');
      container.style.position = 'absolute';
      container.style.left = '-9999px';
      container.style.width = '210mm';
      container.style.padding = '10mm';
      document.body.appendChild(container);

      // Generate canvas from HTML
      const canvas = await html2canvas(container, {
        scale: 2,
        useCORS: true,
        logging: false,
      });

      // Remove temporary container
      document.body.removeChild(container);

      // Create PDF
      const imgData = canvas.toDataURL('image/png');
      const pdf = new jsPDF({
        orientation: 'portrait',
        unit: 'mm',
        format: 'a4',
      });

      const imgWidth = 210;
      const imgHeight = (canvas.height * imgWidth) / canvas.width;
      
      pdf.addImage(imgData, 'PNG', 0, 0, imgWidth, imgHeight);
      
      return pdf;
    } catch (error) {
      console.error('Error generating PDF:', error);
      throw error;
    }
  };

  const sendViaWhatsApp = async () => {
    if (numberStatus !== 'valid') {
      alert('Please verify the WhatsApp number first');
      return;
    }

    setIsSending(true);

    try {
      const formattedNumber = formatWhatsAppNumber(whatsappNumber);
      
      // Generate PDF
      const pdf = await generatePDF(whatsappModal);
      const pdfBlob = pdf.output('blob');
      
      // Create a download link for the PDF
      const pdfUrl = URL.createObjectURL(pdfBlob);
      
      // For web applications, we'll download the PDF and provide WhatsApp link
      // User will need to manually attach the downloaded PDF
      const link = document.createElement('a');
      link.href = pdfUrl;
      link.download = `Insurance_Bill_${whatsappModal.insuranceNumber}.pdf`;
      link.click();
      
      // Open WhatsApp with pre-filled message
      const message = encodeURIComponent(
        `NAEEM MEDICARE - Insurance Bill\n\nInsurance No: ${whatsappModal.insuranceNumber}\nPatient: ${whatsappModal.patientName}\nDate: ${whatsappModal.date}\n\nPlease find the attached PDF for complete bill details.`
      );
      
      const whatsappUrl = `https://wa.me/${formattedNumber}?text=${message}`;
      window.open(whatsappUrl, '_blank');
      
      setIsSending(false);
      setWhatsappModal(null);
      setWhatsappNumber('');
      setNumberStatus(null);
      
      alert('PDF downloaded! Please attach it manually in WhatsApp and send.');
      
    } catch (error) {
      console.error('Error sending via WhatsApp:', error);
      setIsSending(false);
      alert('Failed to generate PDF: ' + error.message);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-teal-50 via-blue-50 to-indigo-100 p-6">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <div className="bg-white rounded-xl shadow-2xl p-6 mb-6">
          <div className="flex flex-col sm:flex-row justify-between items-center gap-4">
            <div className="flex items-center gap-4">
              <button
                onClick={() => setCurrentPage('insurance')}
                className="bg-gray-600 text-white p-3 rounded-lg hover:bg-gray-700 transition-all"
              >
                <ArrowLeft size={24} />
              </button>
              <div>
                <h1 className="text-4xl font-black text-transparent bg-clip-text bg-gradient-to-r from-teal-600 to-blue-600">
                  Insurance Bills
                </h1>
                <p className="text-gray-600 font-semibold mt-1">
                  Total Bills: {bills.length}
                </p>
              </div>
            </div>

            <button
              onClick={() => setCurrentPage('insurance')}
              className="bg-gradient-to-r from-teal-600 to-blue-600 text-white px-6 py-3 rounded-lg hover:shadow-lg transition-all font-bold flex items-center gap-2"
            >
              <FileText size={20} /> New Bill
            </button>
          </div>

          {/* Search Bar */}
          <div className="mt-6 relative">
            <Search className="absolute left-4 top-1/2 transform -translate-y-1/2 text-gray-400" size={20} />
            <input
              type="text"
              placeholder="Search by patient name, insurance number, or CNIC..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full pl-12 pr-4 py-3 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 focus:border-teal-500 outline-none font-semibold"
            />
          </div>
        </div>

        {/* Bills List */}
        <div className="space-y-4">
          {filteredBills.length === 0 ? (
            <div className="bg-white rounded-xl shadow-lg p-12 text-center">
              <FileText size={64} className="mx-auto text-gray-300 mb-4" />
              <p className="text-xl text-gray-500 font-semibold">
                {searchTerm ? 'No bills found matching your search' : 'No insurance bills yet'}
              </p>
            </div>
          ) : (
            filteredBills.map((bill) => (
              <div
                key={bill.id}
                className="bg-white rounded-xl shadow-lg p-6 hover:shadow-2xl transition-all border-2 border-gray-200"
              >
                <div className="flex flex-col lg:flex-row justify-between gap-4">
                  {/* Bill Info */}
                  <div className="flex-1">
                    <div className="flex items-start justify-between mb-3">
                      <div>
                        <h3 className="text-2xl font-black text-gray-900 mb-1">
                          {bill.patientName}
                        </h3>
                        <p className="text-sm font-bold text-teal-600">
                          Insurance No: {bill.insuranceNumber}
                        </p>
                      </div>
                      <div className="text-right">
                        <p className="text-sm font-bold text-gray-600">
                          <Calendar size={14} className="inline mr-1" />
                          {bill.date}
                        </p>
                      </div>
                    </div>

                    <div className="grid grid-cols-2 md:grid-cols-4 gap-3 mb-3">
                      <div className="bg-gray-50 rounded-lg p-2">
                        <p className="text-xs font-bold text-gray-600">Age</p>
                        <p className="text-sm font-bold">{bill.patientAge}</p>
                      </div>
                      <div className="bg-gray-50 rounded-lg p-2">
                        <p className="text-xs font-bold text-gray-600">Gender</p>
                        <p className="text-sm font-bold">{bill.gender}</p>
                      </div>
                      <div className="bg-gray-50 rounded-lg p-2">
                        <p className="text-xs font-bold text-gray-600">CNIC</p>
                        <p className="text-sm font-bold">{bill.patientCNIC}</p>
                      </div>
                      <div className="bg-gray-50 rounded-lg p-2">
                        <p className="text-xs font-bold text-gray-600">Contact</p>
                        <p className="text-sm font-bold">{bill.patientContact || 'N/A'}</p>
                      </div>
                    </div>

                    <div className="bg-blue-50 rounded-lg p-3 mb-3">
                      <p className="text-xs font-bold text-blue-800 mb-1">Diagnosis</p>
                      <p className="text-sm font-semibold text-gray-700">{bill.diagnosis}</p>
                    </div>

                    {bill.medicinesPrescribed && bill.medicinesPrescribed.length > 0 && (
                      <div className="bg-purple-50 rounded-lg p-3 mb-3">
                        <p className="text-xs font-bold text-purple-800 mb-2">
                          Medicines ({bill.medicinesPrescribed.length})
                        </p>
                        <div className="space-y-1">
                          {bill.medicinesPrescribed.map((med, idx) => (
                            <p key={idx} className="text-sm font-semibold text-gray-700">
                               {med.name} - M: {med.morning || '-'}, D: {med.daily || '-'}, E:{' '}
                              {med.evening || '-'} ({med.dosage || 'N/A'})
                            </p>
                          ))}
                        </div>
                      </div>
                    )}

                    {bill.labsOrdered && bill.labsOrdered.length > 0 && (
                      <div className="bg-green-50 rounded-lg p-3 mb-3">
                        <p className="text-xs font-bold text-green-800 mb-2">
                          Labs ({bill.labsOrdered.length})
                        </p>
                        <div className="space-y-1">
                          {bill.labsOrdered.map((lab, idx) => (
                            <p key={idx} className="text-sm font-semibold text-gray-700">
                               {lab.name}
                            </p>
                          ))}
                        </div>
                      </div>
                    )}

                    <div className="bg-gradient-to-r from-orange-50 to-red-50 rounded-lg p-3 border-2 border-orange-200">
                      <div className="grid grid-cols-3 gap-3">
                        <div>
                          <p className="text-xs font-bold text-gray-600">Medicine Total</p>
                          <p className="text-lg font-black text-orange-600">
                            {parseFloat(bill.medicineTotal || 0).toFixed(2)}
                          </p>
                        </div>
                        <div>
                          <p className="text-xs font-bold text-gray-600">Doctor Fees</p>
                          <p className="text-lg font-black text-blue-600">
                            {parseFloat(bill.doctorFees || 0).toFixed(2)}
                          </p>
                        </div>
                        <div>
                          <p className="text-xs font-bold text-gray-600">Total Amount</p>
                          <p className="text-xl font-black text-red-600">
                            {parseFloat(bill.totalAmount || 0).toFixed(2)}
                          </p>
                        </div>
                      </div>
                    </div>
                  </div>

                  {/* Action Buttons */}
                  <div className="flex lg:flex-col gap-2 justify-end">
                    <button
                      onClick={() => handlePrint(bill)}
                      className="bg-gradient-to-r from-blue-600 to-indigo-600 text-white px-4 py-2 rounded-lg hover:shadow-lg transition-all font-bold flex items-center gap-2"
                    >
                      <Printer size={18} /> Print
                    </button>
                    <button
                      onClick={() => openWhatsAppModal(bill)}
                      className="bg-gradient-to-r from-green-500 to-green-600 text-white px-4 py-2 rounded-lg hover:shadow-lg transition-all font-bold flex items-center gap-2"
                    >
                      <Send size={18} /> WhatsApp
                    </button>
                    <button
                      onClick={() => handleEdit(bill)}
                      className="bg-gradient-to-r from-yellow-500 to-orange-500 text-white px-4 py-2 rounded-lg hover:shadow-lg transition-all font-bold flex items-center gap-2"
                    >
                      <Edit size={18} /> Edit
                    </button>
                    <button
                      onClick={() => handleDelete(bill)}
                      className="bg-gradient-to-r from-red-600 to-pink-600 text-white px-4 py-2 rounded-lg hover:shadow-lg transition-all font-bold flex items-center gap-2"
                    >
                      <Trash2 size={18} /> Delete
                    </button>
                  </div>
                </div>
              </div>
            ))
          )}
        </div>

        {/* WhatsApp Modal */}
        {whatsappModal && (
          <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
            <div className="bg-white rounded-xl shadow-2xl max-w-md w-full">
              <div className="bg-gradient-to-r from-green-500 to-green-600 text-white p-6 rounded-t-xl flex justify-between items-center">
                <h2 className="text-2xl font-black">Send via WhatsApp</h2>
                <button
                  onClick={() => {
                    setWhatsappModal(null);
                    setWhatsappNumber('');
                    setNumberStatus(null);
                  }}
                  className="bg-white text-gray-800 p-2 rounded-lg hover:bg-gray-100 transition-all"
                >
                  <X size={24} />
                </button>
              </div>

              <div className="p-6 space-y-4">
                <div>
                  <p className="text-sm font-bold text-gray-700 mb-2">
                    Patient: <span className="text-teal-600">{whatsappModal.patientName}</span>
                  </p>
                  <p className="text-sm font-bold text-gray-700 mb-4">
                    Insurance No: <span className="text-teal-600">{whatsappModal.insuranceNumber}</span>
                  </p>
                </div>

                <div>
                  <label className="block text-sm font-bold text-gray-700 mb-2">
                    WhatsApp Number <span className="text-red-600">*</span>
                  </label>
                  <div className="flex gap-2">
                    <input
                      type="text"
                      placeholder="0300-1234567"
                      value={whatsappNumber}
                      onChange={(e) => {
                        setWhatsappNumber(e.target.value);
                        setNumberStatus(null);
                      }}
                      className="flex-1 px-4 py-3 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-green-500 outline-none font-semibold"
                    />
                    <button
                      onClick={checkWhatsAppNumber}
                      disabled={isChecking}
                      className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-all font-bold disabled:bg-gray-400"
                    >
                      {isChecking ? <Loader size={20} className="animate-spin" /> : 'Verify'}
                    </button>
                  </div>
                  {numberStatus === 'valid' && (
                    <div className="mt-2 flex items-center gap-2 text-green-600">
                      <CheckCircle size={20} />
                      <span className="text-sm font-bold">Number verified!</span>
                    </div>
                  )}
                  {numberStatus === 'invalid' && (
                    <div className="mt-2 flex items-center gap-2 text-red-600">
                      <XCircle size={20} />
                      <span className="text-sm font-bold">Invalid number format</span>
                    </div>
                  )}
                </div>

                <div className="bg-yellow-50 border-2 border-yellow-300 rounded-lg p-4">
                  <p className="text-sm font-semibold text-yellow-800">
                     A PDF will be downloaded. Please attach it manually in WhatsApp.
                  </p>
                </div>

                <button
                  onClick={sendViaWhatsApp}
                  disabled={isSending || numberStatus !== 'valid'}
                  className="w-full bg-gradient-to-r from-green-500 to-green-600 text-white px-6 py-3 rounded-lg hover:shadow-lg transition-all font-black text-lg flex items-center justify-center gap-2 disabled:bg-gray-400 disabled:cursor-not-allowed"
                >
                  {isSending ? (
                    <>
                      <Loader size={24} className="animate-spin" />
                      Generating PDF...
                    </>
                  ) : (
                    <>
                      <Send size={24} />
                      Send to WhatsApp
                    </>
                  )}
                </button>
              </div>
            </div>
          </div>
        )}

        {/* Edit Modal */}
        {editingBill && (
          <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4 overflow-y-auto">
            <div className="bg-white rounded-xl shadow-2xl max-w-4xl w-full max-h-[90vh] overflow-y-auto">
              <div className="sticky top-0 bg-gradient-to-r from-teal-600 to-blue-600 text-white p-6 rounded-t-xl flex justify-between items-center">
                <h2 className="text-2xl font-black">Edit Insurance Bill</h2>
                <button
                  onClick={() => setEditingBill(null)}
                  className="bg-white text-gray-800 p-2 rounded-lg hover:bg-gray-100 transition-all"
                >
                  <X size={24} />
                </button>
              </div>

              <div className="p-6 space-y-6">
                {/* Patient Info */}
                <div>
                  <h3 className="text-lg font-black text-gray-800 mb-3">Patient Information</h3>
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">
                        Patient Name *
                      </label>
                      <input
                        type="text"
                        value={editingBill.patientName}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, patientName: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">Age *</label>
                      <input
                        type="text"
                        value={editingBill.patientAge}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, patientAge: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">Contact</label>
                      <input
                        type="text"
                        value={editingBill.patientContact}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, patientContact: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">CNIC *</label>
                      <input
                        type="text"
                        value={editingBill.patientCNIC}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, patientCNIC: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">Gender</label>
                      <select
                        value={editingBill.gender}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, gender: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                      >
                        <option value="Male">Male</option>
                        <option value="Female">Female</option>
                        <option value="Other">Other</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">Date</label>
                      <input
                        type="date"
                        value={editingBill.date}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, date: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                      />
                    </div>
                  </div>
                </div>

                {/* Diagnosis */}
                <div>
                  <label className="block text-sm font-bold text-gray-700 mb-1">Diagnosis *</label>
                  <textarea
                    value={editingBill.diagnosis}
                    onChange={(e) =>
                      setEditingBill({ ...editingBill, diagnosis: e.target.value })
                    }
                    className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                    rows={3}
                  />
                </div>

                {/* Medicines Prescribed */}
                <div>
                  <h3 className="text-lg font-black text-gray-800 mb-3">Medicines Prescribed</h3>
                  <div className="space-y-4">
                    {editingBill.medicinesPrescribed.map((med, index) => (
                      <div key={index} className="border-2 border-gray-300 rounded-lg p-4 relative">
                        <button
                          onClick={() => removeMedicine(index)}
                          className="absolute top-2 right-2 text-red-600 hover:text-red-800"
                        >
                          <X size={20} />
                        </button>
                        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                          <div className="col-span-2">
                            <label className="block text-sm font-bold text-gray-700 mb-1">Medicine Name *</label>
                            <input
                              type="text"
                              value={med.name}
                              onChange={(e) => updateMedicine(index, 'name', e.target.value)}
                              className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                            />
                          </div>
                          <div>
                            <label className="block text-sm font-bold text-gray-700 mb-1">Dosage</label>
                            <input
                              type="text"
                              value={med.dosage}
                              onChange={(e) => updateMedicine(index, 'dosage', e.target.value)}
                              className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                            />
                          </div>
                          <div>
                            <label className="block text-sm font-bold text-gray-700 mb-1">Morning</label>
                            <input
                              type="text"
                              value={med.morning}
                              onChange={(e) => updateMedicine(index, 'morning', e.target.value)}
                              className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                            />
                          </div>
                          <div>
                            <label className="block text-sm font-bold text-gray-700 mb-1">Daily</label>
                            <input
                              type="text"
                              value={med.daily}
                              onChange={(e) => updateMedicine(index, 'daily', e.target.value)}
                              className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                            />
                          </div>
                          <div>
                            <label className="block text-sm font-bold text-gray-700 mb-1">Evening</label>
                            <input
                              type="text"
                              value={med.evening}
                              onChange={(e) => updateMedicine(index, 'evening', e.target.value)}
                              className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                            />
                          </div>
                        </div>
                      </div>
                    ))}
                    <button
                      onClick={addMedicine}
                      className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-all font-bold flex items-center gap-2"
                    >
                      <Plus size={18} /> Add Medicine
                    </button>
                  </div>
                </div>

                {/* Labs Ordered */}
                <div>
                  <h3 className="text-lg font-black text-gray-800 mb-3">Labs Ordered</h3>
                  <div className="space-y-2">
                    {editingBill.labsOrdered.map((lab, index) => (
                      <div key={index} className="flex gap-2 items-center">
                        <input
                          type="text"
                          value={lab.name}
                          onChange={(e) => updateLab(index, e.target.value)}
                          className="flex-1 px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-semibold"
                          placeholder="Lab Name"
                        />
                        <button
                          onClick={() => removeLab(index)}
                          className="bg-red-600 text-white px-4 py-2 rounded-lg hover:bg-red-700 transition-all"
                        >
                          <Trash2 size={18} />
                        </button>
                      </div>
                    ))}
                    <button
                      onClick={addLab}
                      className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-all font-bold flex items-center gap-2"
                    >
                      <Plus size={18} /> Add Lab
                    </button>
                  </div>
                </div>

                {/* Billing */}
                <div>
                  <h3 className="text-lg font-black text-gray-800 mb-3">Billing</h3>
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">
                        Medicine Total ()
                      </label>
                      <input
                        type="number"
                        step="0.01"
                        value={editingBill.medicineTotal}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, medicineTotal: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-bold text-lg"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-bold text-gray-700 mb-1">
                        Doctor Fees ()
                      </label>
                      <input
                        type="number"
                        step="0.01"
                        value={editingBill.doctorFees}
                        onChange={(e) =>
                          setEditingBill({ ...editingBill, doctorFees: e.target.value })
                        }
                        className="w-full px-4 py-2 border-2 border-gray-300 rounded-lg focus:ring-2 focus:ring-teal-500 outline-none font-bold text-lg"
                      />
                    </div>
                  </div>
                  <div className="mt-4 bg-gradient-to-r from-orange-600 to-red-600 text-white rounded-lg p-4">
                    <p className="text-sm font-bold">Total Amount</p>
                    <p className="text-3xl font-black">
                      
                      {(
                        parseFloat(editingBill.medicineTotal || 0) +
                        parseFloat(editingBill.doctorFees || 0)
                      ).toFixed(2)}
                    </p>
                  </div>
                </div>

                {/* Save Button */}
                <button
                  onClick={handleSaveEdit}
                  className="w-full bg-gradient-to-r from-green-600 to-teal-600 text-white px-6 py-3 rounded-lg hover:shadow-lg transition-all font-black text-lg flex items-center justify-center gap-2"
                >
                  <Save size={24} /> Save Changes
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}